import React from "react";
import { Button } from "@material-ui/core";

function Game() {
  function renderSquare(i: number) {
    return <Button>-</Button>;
  }

  return (
    <div>
      {renderSquare(0)}
      {renderSquare(1)}
      {renderSquare(2)}
      <br></br>
      {renderSquare(3)}
      {renderSquare(4)}
      {renderSquare(5)}
      <br></br> {renderSquare(6)}
      {renderSquare(7)}
      {renderSquare(8)}
      <br></br>
    </div>
  );
}

export default Game;
